import React, { Component } from "react";

class Title extends Component {
  state = {
    username: "My name",
    profilePic:
      "https://bigmemes.funnyjunk.com/pictures/Dolan+duck+profile+picture+feel+free+to+share+this+epic_97d32e_3518960.jpg"
  };
  render() {
    return (
      <header>
        <h1>NC News</h1>
        :Logged In As: {this.state.username}
      </header>
    );
  }
}

export default Title;
